import React,{ Component } from 'react'
class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            data:"js是世界上最好的语言"
        };
    }
    render() {
        return (
            <div style={{backgroundColor:"#0ff",fontSize:"20px",color:"#00f"}}>
                {this.state.data}
            </div>
        )
    }
}
export default App;
